import React from "react";
import world from "./world.png";

const Passport = () => {
  return (
    <div
      style={{
        background: `url(${world})`,
        height: "100vh",
        width: "100%",
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
      }}
    >
      <h1>Here is your passport!</h1>
    </div>
  );
};

export default Passport;
